import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
import background from './background.svg';


ReactDOM.render(
  <React.StrictMode>
    <div className="container" style={{
    backgroundImage: `url(${background})`}}>
    <App />
  </div>
  </React.StrictMode>,
  document.getElementById('root')
);

